d3.json("./data/conus.topo.json", function(error, us) {
  if (error) throw error;

  var conus = topojson.feature(us, {
    type: "GeometryCollection",
    geometries: us.objects.conus.geometries
  });

  // Projection
  myProjection = d3.geoAlbersUsa()
      .fitSize([width, height], conus);
  var path = d3.geoPath()
      .projection(myProjection);

  svg.append("path")
      .datum(conus)
      .attr("fill","#fff")
      .attr("d", path);


  d3.json("./data/interstatePaths.json", function(error, r) {
    if (error) throw error;
    svg.append("path")
        .datum(r)
        .attr("fill","none")
        .attr("stroke","#ddd")
        .attr("stroke-width",1)
        .attr("d", path);

    svgmarker = svg
              .append("circle")
              .attr("from",Math.floor(18*Math.random()));
    svgmarker .attr("cx",function(){
                  var ll = [nodes[svgmarker.attr("from")].x, nodes[svgmarker.attr("from")].y]
                  var pp = myProjection(ll)
                  return pp[0];
                })
              .attr("cy",function(){
                  var ll = [nodes[svgmarker.attr("from")].x, nodes[svgmarker.attr("from")].y]
                  var pp = myProjection(ll)
                  return pp[1];
                })
              .attr("class","marker")
              .attr("fill","#333")
              .attr("stroke","none")
              .attr("r",5);
    // Dynamic Stuff
    svgmarker.transition()
              .on("start", visit);
  });
});

function visit(){
  var myFrom = Number(svgmarker.attr("from"))
  var myTo = myFrom;
  while (myTo==myFrom){
    myTo = Math.floor(18*Math.random());
  }
  svgmarker.attr("to",myTo);
  console.log("hi "+Math.round(1000*Math.random()));
  var myRouteList = routesDJ[myFrom][myTo];
  //svgmarker.transition()
  //      .on("end", function(){takeRoute(myRouteList);});
  if (GlobalVizView.header){
    takeRoute(myRouteList);
  }
}


function takeRoute(routeList){
  if (routeList.length>1){
    var N = routeList[0];
    var routeIndex = edges.findIndex(x => x.id==N);
    d3.select("#edgeName").html(edges[routeIndex].name);
    d3.select("#edgeDir").html(edges[routeIndex].d);
    svgmarker.attr("to",edges[routeIndex].dest);
    var myRoute = edges[routeIndex].route;
    svgmarker//.attr("stroke","blue")
          .transition()
          .on("start", function(){travelAlong( myRoute.slice(1),  function(){takeRoute(routeList.slice(1))} )}            );
          //.on("end",    );
  } else {
    var N = routeList[0];
    var routeIndex = edges.findIndex(x => x.id==N);
    d3.select("#edgeName").html(edges[routeIndex].name);
    d3.select("#edgeDir").html(edges[routeIndex].d);
    svgmarker.attr("to",edges[routeIndex].dest);
    var myRoute = edges[routeIndex].route;
    svgmarker//.attr("stroke","red")
        .transition()
        .on("start", function(){travelAlong(myRoute.slice(1), visit)} );
        //.on("start", visit);
  }
  svgmarker.attr("from",svgmarker.attr("to"));
}

function travelAlong(routePath, actionOnCompletion){
  if (routePath.length>1){
    var myDest = routePath[0];
    if (!myDest.c || 0===myDest.c.length){
      d3.select("#destLat").html('<br>');
    }
    else{
      d3.select("#destLat").html(myDest.c);
    }
    //var routeIndex = edges.findIndex(x => x.id==N);
    //var myRoute = edges[routeIndex].route;
    svgmarker.transition()
      .duration((myDest.L)/DJspeed)
      .ease(d3.easeLinear)
      .attr("cx",function(){
          var ll = [myDest.x, myDest.y]
          var pp = myProjection(ll)
          return pp[0];
        })
      .attr("cy",function(){
          var ll = [myDest.x, myDest.y]
          var pp = myProjection(ll)
          return pp[1];
        })
          .on("end", function(){travelAlong(routePath.slice(1), actionOnCompletion)});
  } else {
    var myDest = routePath[0];
    if (!myDest.c || 0===myDest.c.length){
      d3.select("#destLat").html('<br>');
    }
    else{
      d3.select("#destLat").html(myDest.c);
    }
    //var routeIndex = edges.findIndex(x => x.id==N);
    //var myRoute = edges[routeIndex].route;
    svgmarker.transition()
      .duration((myDest.L)/DJspeed)
      .ease(d3.easeLinear)
      .attr("cx",function(){
          var ll = [myDest.x, myDest.y]
          var pp = myProjection(ll)
          return pp[0];
        })
      .attr("cy",function(){
          var ll = [myDest.x, myDest.y]
          var pp = myProjection(ll)
          return pp[1];
        })
          .on("end", actionOnCompletion);
    //.transition()
    //    .on("start", visit);
  }
}
